import styled from "styled-components";

export const TodoListContainer = styled.div`
  width: 500px;
  background-color: #cef5f5;
  display: flex;
  flex-direction: column;
  margin: 30px;
  box-sizing: border-box;
  padding: 10px;
  border-radius: 10px;
`;
